settings.markerImageFunction:
var mood = data['mood'];
var index = 0;
switch (mood) { 
    case 'Happy':
        index = 0;
        break;
    case 'Sad':
        index = 1;
        break;
    case 'Tired':
        index = 2;
        break;
    case 'Angry':
        index = 3;
        break;
    default:
        break;
}
var res = {
    url: images[index],
    size: 60  
};
return res;

